import React, { useState } from 'react';
import Card  from './Card';
import MenuList  from './Card';
import "./index.css"
import Navbar from './Card';
import Sdata from "./Sdata";
 


const App = () => {

    const [Menudata , Setdata ] = useState();

    const filterItems = (categery) => {
        const   UpdatedList = Sdata.filter((curElem) => {
              return curElem.categery === categery;
            });
           return Setdata.UpdatedList;
            }
    return(<>
        <div className="container">

            <h1 className="heading"> WELCOME TO SHUBHAM FOODS</h1>
            <div className="navbar">  <button onClick={filterItems("Breakfast")}>breakfast </button></div>
            <div className="box"> <Card Menudata={Menudata} /> </div>

        </div>
    </>


    )






}

export default App;
